(208, 208, 1, 'Duiksport', 'duiksport', 'duiken/duiksport', '{\"142b5f84-690d-4a75-867a-45699ae462ec\": \"Brevetten\", \"37445e1b-1a71-4fe6-a218-835632f3e1f5\": \"<p>Ontdek de duiksport, een fascinerende activiteit die je meeneemt naar een compleet andere wereld onder water. Duiken biedt een unieke kans om te genieten van gewichtloosheid, omringd door prachtige zee- en koraalriffen, kleurrijke vissen en verbazingwekkende flora. Of je nu in tropische wateren duikt of langs wrakken op zoek gaat naar verborgen schatten, elke duik is een avontuur vol ontdekkingen. Het gevoel van vrijheid en rust onder water is ongeÃ«venaard.Â <br /><br />Duiken is niet alleen een sport, maar een passie die je meeneemt naar onbekende en betoverende bestemmingen. Ontdek zelf waarom duiken zo\'n unieke en opwindende ervaring is!</p>\", \"b0249a27-683d-4f48-8104-f65696d4d10a\": \"Ontdek de duiksport\"}', 1, '2024-05-26 02:42:03', '2024-06-15 12:39:29', '069f59a6-15d9-40c3-8ef2-a521b440485b'),
