(214, 214, 1, 'Lessen', 'lessen', 'duiken/lessen', '{\"45a0fc4e-c80d-4907-95af-12998b75a65f\": \"Lessen en brevetten\", \"4b5d0266-b49f-4510-bfa5-d8fc442d92b6\": \"<p>Bij Duikclub Dolfijn organiseren we zwembadtrainingen op dinsdagavond van 21u tot 22u, waar je onder begeleiding van onze ervaren instructeurs kunt werken aan je duikvaardigheden en -technieken. Deze praktijkgerichte sessies zijn essentieel voor het opbouwen van vertrouwen en comfort onder water.<br /><br />Daarnaast bieden we theorielessen aan in samenspraak met de cursisten die werken aan een specifiek duikbrevet. Onze instructeurs staan klaar om de benodigde kennis te delen en eventuele vragen te beantwoorden ter voorbereiding op examenmomenten.</p><p>Voor liefhebbers van buitenduiken organiseren we regelmatig duikuitstapjes op basis van activiteiten in onze kalender. Dit biedt de ideale gelegenheid om je duikvaardigheden toe te passen in natuurlijke omgevingen en nieuwe duiklocaties te verkennen.<br /><br />Wil je meer weten over onze lessen en brevetten? Neem contact met ons op of kom langs tijdens een van onze zwembadtrainingen om kennis te maken met Duikclub Dolfijn en ons enthousiaste team van duikliefhebbers!</p>\"}', 1, '2024-05-26 02:47:02', '2024-06-15 12:39:29', '5eb60328-3fac-418c-b93a-97420827dbca'),
