(252, 252, 1, 'Over ons', 'over-ons', 'over-ons', '{\"144727a3-7d8e-42af-a3e7-66b87dad1bd8\": \"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2518.1229261681697!2d5.5095961764295405!3d50.86592397167446!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47c0e0b9fe04ea1d%3A0xdd47456e41a19bdb!2sEikenlaan%2025%2C%203740%20Bilzen!5e0!3m2!1snl!2sbe!4v1718501274778!5m2!1snl!2sbe\", \"2bc93924-7902-454f-9839-8cc27ab99537\": \"Waar vind je ons?\", \"32fdd704-f45a-499b-bac9-c9090f2f0265\": \"Met dank aan:\", \"399ce0e5-7f58-4fee-bd35-b3a95b21ab50\": \"Over de duikclub\", \"73504e16-f45a-49a9-baf2-1a461a4b4aeb\": \"<p>Duikclub Dolfijn is een enthousiaste en gezellige duikvereniging gevestigd in Bilzen. Onze club is opgericht met als doel duikliefhebbers samen te brengen en hen de kans te bieden om hun passie voor duiken te delen en te ontwikkelen. Of je nu een beginner bent die wil leren duiken of een ervaren duiker op zoek naar nieuwe duikavonturen, bij Duikclub Dolfijn ben je aan het juiste adres.<br /><br />Wij bieden een vriendelijke en ondersteunende omgeving waarin je kunt leren duiken onder begeleiding van ervaren instructeurs. Onze wekelijkse trainingsavonden in het Stedelijk Zwembad De Kimpel zijn een uitstekende gelegenheid om je duikvaardigheden te verbeteren of gewoon plezier te hebben met gelijkgestemde duikers. Daarnaast organiseren we regelmatig duikuitstapjes naar verschillende duiklocaties, zowel binnen als buiten BelgiÃ«.</p>\", \"af0198f9-40dd-4c08-9608-66990acd2e03\": \"Het bestuur\", \"d48a8852-c3e6-454c-92b5-dc5c780bbe9a\": \"Wat doen wij?\"}', 1, '2024-05-26 03:17:18', '2024-06-16 01:33:09', '5c253c96-b946-48e8-8ce6-ab101f3cacaa'),
