(257, 257, 1, 'Over ons', 'over-ons', 'over-ons', '{\"73504e16-f45a-49a9-baf2-1a461a4b4aeb\": \"<p>Duikclub Dolfijn is een enthousiaste en gezellige duikvereniging gevestigd in Bilzen. Onze club is opgericht met als doel duikliefhebbers samen te brengen en hen de kans te bieden om hun passie voor duiken te delen en te ontwikkelen. Of je nu een beginner bent die wil leren duiken of een ervaren duiker op zoek naar nieuwe duikavonturen, bij Duikclub Dolfijn ben je aan het juiste adres.<br /><br />Wij bieden een vriendelijke en ondersteunende omgeving waarin je kunt leren duiken onder begeleiding van ervaren instructeurs. Onze wekelijkse trainingsavonden in het Stedelijk Zwembad De Kimpel zijn een uitstekende gelegenheid om je duikvaardigheden te verbeteren of gewoon plezier te hebben met gelijkgestemde duikers. Daarnaast organiseren we regelmatig duikuitstapjes naar verschillende duiklocaties, zowel binnen als buiten BelgiÃ«.</p>\", \"af0198f9-40dd-4c08-9608-66990acd2e03\": \"Het bestuur\", \"d48a8852-c3e6-454c-92b5-dc5c780bbe9a\": \"Wat doen wij?\", \"db20ceef-7e17-4f29-9259-c9d1abd4b8e6\": \"Met dank aan\"}', 1, '2024-05-26 03:19:24', '2024-05-26 03:19:24', '8ac94068-7dee-4d8f-8cef-b1f5e48a536a'),
(258, 258, 1, 'Initiatie', 'initiatie', 'lessen-initiatie', '{\"12433941-f7f4-4936-ae83-f8bd6b71e3f3\": \"<p>Wil je vooraf al eens proberen tijdens een gratis initiatie in het zwembad te Bilzen dan kan dat. Je krijgt er ondermeer uitleg over de verschillende opleidingen, het lidmaatschap, de kosten, ... Daarna bieden we je de mogelijkheid om een en ander eens in het water uit te proberen en om zelfs met een duikfles rond te zwemmen.<br /><br />Zit je nog met vragen? Contacteer ons of schrijf je in voor een les en stel ze ons terplekke.Â </p>\", \"95bec8a5-7cd3-4c54-8014-5afebb2b5e4f\": \"Duik in een nieuw avontuur!\", \"9fd5feee-3702-4799-8d6f-884848e91c84\": \"Gratis Duikinitiatie\", \"e0912763-f97f-43a5-ae5f-c4e432eef444\": \"<p>*maak tijdens deze initiatieles gratis gebruik van duikmateriaal van de club.</p>\", \"e6bf49c4-3760-4743-9412-454bcbe155e2\": \"<p>Dompel jezelf onder in een wereld van avontuur en ontdekking!Â <br />Een initiatie om te leren duiken biedt je de perfecte kans om de magie van de onderwaterwereld te ervaren. Kom zeker langs bij Duikclub Dolfijn in Zwembad De Kimpel Bilzen en zet de eerste stap naar een leven vol duikplezier!</p>\", \"f6a970bf-adc8-460a-98a2-46bb6cf11594\": \"Schrijf je in voor de initiatie!\"}', 1, '2024-05-26 03:26:11', '2024-06-15 23:58:33', '0ac8a181-4934-4cec-af65-066291a03692'),
