(401, 401, 1, 'Duiksport', 'duiksport', 'duiksport', '{\"013c7531-4f6b-491b-b9c6-77ff0dd56eee\": \"Met dank aan:\", \"37445e1b-1a71-4fe6-a218-835632f3e1f5\": \"<p>Ontdek de duiksport, een fascinerende activiteit die je meeneemt naar een compleet andere wereld onder water. Duiken biedt een unieke kans om te genieten van gewichtloosheid, omringd door prachtige zee- en koraalriffen, kleurrijke vissen en verbazingwekkende flora. Of je nu in tropische wateren duikt of langs wrakken op zoek gaat naar verborgen schatten, elke duik is een avontuur vol ontdekkingen. Het gevoel van vrijheid en rust onder water is ongeÃ«venaard.Â <br /><br />Duiken is niet alleen een sport, maar een passie die je meeneemt naar onbekende en betoverende bestemmingen. Ontdek zelf waarom duiken zo\'n unieke en opwindende ervaring is!</p>\", \"9ed1f172-7fc6-4489-810a-40307295d57b\": \"Brevetten\", \"b0249a27-683d-4f48-8104-f65696d4d10a\": \"Ontdek de duiksport!\"}', 1, '2024-06-15 12:37:06', '2024-06-15 21:01:59', '85edb982-af0b-4fad-b9e3-57eafed54adc'),
(402, 402, 1, 'Duiksport', 'duiksport', NULL, NULL, 1, '2024-06-15 12:37:06', '2024-06-15 12:37:06', '810c98c8-5a34-4e05-8335-73271d70b1cb'),
(403, 403, 1, 'Duiksport', 'duiksport', 'duiksport', NULL, 1, '2024-06-15 12:37:07', '2024-06-15 12:37:07', '980bc065-d8cd-48c7-bdf9-d574a2842255'),
(404, 404, 1, 'Prijzen', 'prijzen', 'prijzen', '{\"4dd16c56-650f-4444-b4c0-0b7e73355101\": \"Lidgeld\", \"523b81a7-624c-47f7-ac9a-7571b45d0e90\": \"Indoor\", \"6fa59126-40a5-4b75-bce1-e447589332b9\": \"Outdoor\", \"8a043abb-9870-4609-91ee-09efadcd82af\": \"<p>Het lidmaatschap bij Duikclub Dolfijn bedraagt slechts â¬135 per jaar. Met dit lidgeld krijg je toegang tot onze wekelijkse duiksessies, gebruik van clubmateriaal, deelname aan clubuitstappen en nog veel meer. Het is een fantastische investering in jouw duikervaring en biedt de mogelijkheid om deel uit te maken van een geweldige duikgemeenschap. Sluit je vandaag nog aan en ontdek de onderwaterwereld met Duikclub Dolfijn!</p>\", \"af5b3b82-0a03-4cac-a6d1-054bebbf55af\": \"Duikmateriaal\", \"bab8b5a1-466b-4cf8-86a9-48acf42bd10d\": \"<p>Voor duikers die geÃ¯nteresseerd zijn in het verkennen van de onderwaterwereld tijdens buitenduiken, is het belangrijk om te investeren in hoogwaardige duikuitrusting. De kosten voor een volledige set duikmateriaal voor buitenduiken kunnen rond de â¬2000 liggen.</p><p>Dit omvat items zoals een duikpak, een trimvest, een duikfles, een loodgordel, een duikbril, zwemvinnen en een ademautomaat.</p><p>In de duikfles zit er lucht (samengeperste lucht) of nitrox (ademgas met een hoger zuurstofpercentage dan in lucht). Het ademautomaat stelt je in staat onder water te ademen en zo voor langere tijd onder het wateroppervlak te blijven. De loodgordel zorgt ervoor dat je ook daadwerkelijk onder water blijft en door meer of minder lucht in het trimvest te laten blijf je gewichtloos zweven in het water. Met behulp van de vinnen kun je je bovendien vrij gemakkelijk door het water verplaatsen en tijdens het onder water zwemmen de prachtige onderwaterwereld ontdekken.</p><p>Het is verstandig om te investeren in duurzame en betrouwbare uitrusting om optimaal te kunnen genieten van je duikervaringen. Neem contact met ons op voor advies over het kiezen van de juiste uitrusting voor jouw buitenduikavonturen.</p>\", \"c218e80a-35d8-4fc0-b212-526588bf212e\": \"Prijzen\", \"e0e2eb51-d438-4bd0-82bb-15d8baa7284a\": \"<p>Als nieuwe duiker kun je verwachten dat de kosten voor basis duikmateriaal voor gebruik in het zwembad rond de â¬200 liggen. Dit omvat essentiÃ«le items zoals een duikmasker, snorkel, vinnen en een duikpak. Het is belangrijk om goed uitgerust te zijn voor onze trainingsessies, en dit bedrag geeft een indicatie van wat je kunt verwachten wanneer je zelf duikuitrusting gaat aanschaffen. Neem gerust contact met ons op voor meer advies over het kiezen van de juiste duikuitrusting voor jouw behoeften.</p>\"}', 1, '2024-06-15 12:38:30', '2024-06-15 21:26:27', '4d1643de-5e85-4ade-b784-ae76f63adc79'),
(405, 405, 1, 'prijzen', 'prijzen', 'prijzen', NULL, 1, '2024-06-15 12:38:30', '2024-06-15 12:38:30', '158dae0c-25f5-4761-8e30-26557531ffc6'),
(406, 406, 1, 'Duiken', 'duiken', 'duiken', '{\"169cfd50-d6a7-4881-b32c-f8f985d3f55d\": \"duiken\", \"5b1b0ef9-4261-4fe6-ad78-fdb7af05752f\": \"<p>Ben je nieuwsgierig naar de onderwaterwereld en vraag je je af of duiken iets voor jou is? Bij Duikclub Dolfijn verwelkomen we zowel beginners als ervaren duikers die hun passie willen verdiepen.<br /><br />Als je interesse hebt om te leren duiken of gewoon meer wilt weten over deze opwindende activiteit, aarzel dan niet om contact met ons op te nemen. Duiken is voor iedereen die houdt van avontuur, ontdekking en plezier onder water!</p>\", \"e275e3d7-d8d9-48c9-8619-e86894523799\": \"Meer info over duiken\", \"e7538bab-85e1-41d0-a1e5-122140646269\": \"Is duiken iets voor jou?\"}', 1, '2024-06-15 12:39:51', '2024-06-15 19:28:32', '8b619e9e-3eb8-47ae-a6b5-ddd02e462a92'),
(407, 407, 1, 'Duiken', 'duiken', 'duiken', NULL, 1, '2024-06-15 12:39:52', '2024-06-15 12:39:52', 'f5f30d29-9246-4440-bee1-737bac1b6476'),
(408, 408, 1, 'Lessen', 'lessen', 'lessen', '{\"339c3646-4049-42b4-b6b7-a416eae14fc4\": \"Brevetten\", \"45a0fc4e-c80d-4907-95af-12998b75a65f\": \"Lessen en brevetten\", \"4b5d0266-b49f-4510-bfa5-d8fc442d92b6\": \"<p>Bij Duikclub Dolfijn organiseren we zwembadtrainingen op dinsdagavond van 21u tot 22u, waar je onder begeleiding van onze ervaren instructeurs kunt werken aan je duikvaardigheden en -technieken. Deze praktijkgerichte sessies zijn essentieel voor het opbouwen van vertrouwen en comfort onder water.<br /><br />Daarnaast bieden we theorielessen aan in samenspraak met de cursisten die werken aan een specifiek duikbrevet. Onze instructeurs staan klaar om de benodigde kennis te delen en eventuele vragen te beantwoorden ter voorbereiding op examenmomenten.</p><p>Voor liefhebbers van buitenduiken organiseren we regelmatig duikuitstapjes op basis van activiteiten in onze kalender. Dit biedt de ideale gelegenheid om je duikvaardigheden toe te passen in natuurlijke omgevingen en nieuwe duiklocaties te verkennen.<br /><br />Wil je meer weten over onze lessen en brevetten? Neem contact met ons op of kom langs tijdens een van onze zwembadtrainingen om kennis te maken met Duikclub Dolfijn en ons enthousiaste team van duikliefhebbers!</p>\"}', 1, '2024-06-15 12:40:58', '2024-06-15 23:24:22', '585855d7-71ef-458b-8fdf-b53f83c72466'),
(409, 409, 1, 'Lessen', 'lessen', 'lessen', NULL, 1, '2024-06-15 12:40:58', '2024-06-15 12:40:58', 'd7b2fd28-82eb-4c5e-bf96-ef0bf75a262a'),
(410, 410, 1, 'Over ons', 'over-ons', 'over-ons', '{\"73504e16-f45a-49a9-baf2-1a461a4b4aeb\": \"<p>Duikclub Dolfijn is een enthousiaste en gezellige duikvereniging gevestigd in Bilzen. Onze club is opgericht met als doel duikliefhebbers samen te brengen en hen de kans te bieden om hun passie voor duiken te delen en te ontwikkelen. Of je nu een beginner bent die wil leren duiken of een ervaren duiker op zoek naar nieuwe duikavonturen, bij Duikclub Dolfijn ben je aan het juiste adres.<br /><br />Wij bieden een vriendelijke en ondersteunende omgeving waarin je kunt leren duiken onder begeleiding van ervaren instructeurs. Onze wekelijkse trainingsavonden in het Stedelijk Zwembad De Kimpel zijn een uitstekende gelegenheid om je duikvaardigheden te verbeteren of gewoon plezier te hebben met gelijkgestemde duikers. Daarnaast organiseren we regelmatig duikuitstapjes naar verschillende duiklocaties, zowel binnen als buiten BelgiÃ«.</p>\", \"af0198f9-40dd-4c08-9608-66990acd2e03\": \"Het bestuur\", \"d48a8852-c3e6-454c-92b5-dc5c780bbe9a\": \"Wat doen wij?\", \"db20ceef-7e17-4f29-9259-c9d1abd4b8e6\": \"Met dank aan\"}', 1, '2024-06-15 12:59:30', '2024-06-15 12:59:30', 'f4b9fd9a-ccf6-448a-a381-e7a15af97338'),
