(439, 439, 1, 'Lessen initiatie', 'lessen-initiatie', 'lessen-initiatie', '{\"12433941-f7f4-4936-ae83-f8bd6b71e3f3\": \"<p>Wil je vooraf al eens proberen tijdens een gratis initiatie in het zwembad te Bilzen dan kan dat. Je krijgt er ondermeer uitleg over de verschillende opleidingen, het lidmaatschap, de kosten, ... Daarna bieden we je de mogelijkheid om een en ander eens in het water uit te proberen en om zelfs met een duikfles rond te zwemmen.<br /><br />Zit je nog met vragen? Contacteer ons of schrijf je in voor een les en stel ze ons terplekke.Â </p>\", \"95bec8a5-7cd3-4c54-8014-5afebb2b5e4f\": \"Duik in een nieuw avontuur!\", \"9fd5feee-3702-4799-8d6f-884848e91c84\": \"Gratis Duikinitiatie\", \"e0912763-f97f-43a5-ae5f-c4e432eef444\": \"<p>*maak tijdens deze initiatieles gratis gebruik van duikmateriaal van de club.</p>\", \"e6bf49c4-3760-4743-9412-454bcbe155e2\": \"<p>Dompel jezelf onder in een wereld van avontuur en ontdekking!Â <br />Een initiatie om te leren duiken biedt je de perfecte kans om de magie van de onderwaterwereld te ervaren. Kom zeker langs bij Duikclub Dolfijn in Zwembad De Kimpel Bilzen en zet de eerste stap naar een leven vol duikplezier!</p>\", \"f6a970bf-adc8-460a-98a2-46bb6cf11594\": \"Schrijf je in voor de initiatie!\"}', 1, '2024-06-15 15:19:20', '2024-06-15 15:19:20', '4428bde5-f8b6-4cee-8566-8719f986f4c5'),
