(468, 468, 1, 'Weekends', 'weekends', 'wat-doen-wij/weekends', '{\"06d520ac-ea02-4177-9a52-d5e12f80b4d8\": \"<p>Klinkt een heel weekend duiken voor jou ook als hemel op aarde?Â <br /><br />Aarzel dan niet om mee te komen genieten tijdens een van onze weekends in Mol, Zeeland, op het botenweekend van Limos of stel zelf een locatie voor! Wij staan open voor suggesties.Â <br /><br />Bang dat je misschien nog niet het geweste niveau behaalt? Afhankelijk van de duikers passen wij de locatie aan.Â <br /><br />Wil je meer weten over de weekends? Log in en bekijk de kalender.</p>\"}', 1, '2024-06-15 16:20:39', '2024-06-16 11:01:41', 'b47b4116-7f34-4b3e-870c-824603b71832'),
