(502, 502, 1, 'Duiken', 'duiken', 'duiken', '{\"5b1b0ef9-4261-4fe6-ad78-fdb7af05752f\": \"<p>Ontdek de duiksport, een fascinerende activiteit die je meeneemt naar een compleet andere wereld onder water. Duiken biedt een unieke kans om te genieten van gewichtloosheid, omringd door prachtige zee- en koraalriffen, kleurrijke vissen en verbazingwekkende flora. Of je nu in tropische wateren duikt of langs wrakken op zoek gaat naar verborgen schatten, elke duik is een avontuur vol ontdekkingen. Het gevoel van vrijheid en rust onder water is ongeÃ«venaard.Â <br /><br />Duiken is niet alleen een sport, maar een passie die je meeneemt naar onbekende en betoverende bestemmingen. Ontdek zelf waarom duiken zo\'n unieke en opwindende ervaring is!</p>\", \"e275e3d7-d8d9-48c9-8619-e86894523799\": \"Brevetten\", \"e7538bab-85e1-41d0-a1e5-122140646269\": \"Ontdek de duiksport\"}', 1, '2024-06-15 19:17:41', '2024-06-15 19:17:41', 'a8007ccb-86c8-4173-b6c7-5e4017432d7d'),
