(545, 545, 1, 'Prijzen', 'prijzen', 'prijzen', '{\"4dd16c56-650f-4444-b4c0-0b7e73355101\": \"Lidgeld\", \"523b81a7-624c-47f7-ac9a-7571b45d0e90\": \"Indoor\", \"6fa59126-40a5-4b75-bce1-e447589332b9\": \"Outdoor\", \"8a043abb-9870-4609-91ee-09efadcd82af\": \"<p>Het lidmaatschap bij Duikclub Dolfijn bedraagt slechts â¬135 per jaar. Met dit lidgeld krijg je toegang tot onze wekelijkse duiksessies, gebruik van clubmateriaal, deelname aan clubuitstappen en nog veel meer. Het is een fantastische investering in jouw duikervaring en biedt de mogelijkheid om deel uit te maken van een geweldige duikgemeenschap. Sluit je vandaag nog aan en ontdek de onderwaterwereld met Duikclub Dolfijn!</p>\", \"af5b3b82-0a03-4cac-a6d1-054bebbf55af\": \"Duikmateriaal\", \"bab8b5a1-466b-4cf8-86a9-48acf42bd10d\": \"<p>Voor duikers die geÃ¯nteresseerd zijn in het verkennen van de onderwaterwereld tijdens buitenduiken, is het belangrijk om te investeren in hoogwaardige duikuitrusting. De kosten voor een volledige set duikmateriaal voor buitenduiken kunnen rond de â¬2000 liggen.</p><p>Dit omvat items zoals een duikpak, een trimvest, een duikfles, een loodgordel, een duikbril, zwemvinnen en een ademautomaat.</p><p>In de duikfles zit er lucht (samengeperste lucht) of nitrox (ademgas met een hoger zuurstofpercentage dan in lucht). Het ademautomaat stelt je in staat onder water te ademen en zo voor langere tijd onder het wateroppervlak te blijven. De loodgordel zorgt ervoor dat je ook daadwerkelijk onder water blijft en door meer of minder lucht in het trimvest te laten blijf je gewichtloos zweven in het water. Met behulp van de vinnen kun je je bovendien vrij gemakkelijk door het water verplaatsen en tijdens het onder water zwemmen de prachtige onderwaterwereld ontdekken.</p><p>Het is verstandig om te investeren in duurzame en betrouwbare uitrusting om optimaal te kunnen genieten van je duikervaringen. Neem contact met ons op voor advies over het kiezen van de juiste uitrusting voor jouw buitenduikavonturen.</p>\", \"c218e80a-35d8-4fc0-b212-526588bf212e\": \"Prijzen\", \"e0e2eb51-d438-4bd0-82bb-15d8baa7284a\": \"<p>Als nieuwe duiker kun je verwachten dat de kosten voor basis duikmateriaal voor gebruik in het zwembad rond de â¬200 liggen. Dit omvat essentiÃ«le items zoals een duikmasker, snorkel, vinnen en een duikpak. Het is belangrijk om goed uitgerust te zijn voor onze trainingsessies, en dit bedrag geeft een indicatie van wat je kunt verwachten wanneer je zelf duikuitrusting gaat aanschaffen. Neem gerust contact met ons op voor meer advies over het kiezen van de juiste duikuitrusting voor jouw behoeften.</p>\"}', 1, '2024-06-15 21:08:30', '2024-06-15 21:08:30', 'c18752ec-7758-4af3-8578-11a30cd30a34'),
