(575, 575, 1, 'Duikplaatsen', 'duikplaatsen', 'duikplaatsen', '{\"6a48d224-6eb2-40e8-97f0-2a40c99a668d\": \"Duikplaatsen\", \"cd0f9f85-2720-4a9b-ab91-cb13fb001483\": \"<p>Duikclub Dolfijn verkent een verscheidenheid aan duikplaatsen, variÃ«rend van steengroeven tot zandputten en zeelandlocaties.Â <br /><br />Elke duikplaats biedt unieke ervaringen en uitdagingen, waardoor we onze leden een gevarieerd en opwindend duikprogramma kunnen bieden. Ontdek met ons de prachtige onderwaterwereld op deze diverse locaties!</p>\"}', 1, '2024-06-15 22:56:45', '2024-06-15 22:56:45', '2dbe22da-f4da-4593-8b1c-45fc87425900'),
(577, 577, 1, 'Lessen', 'lessen', 'lessen', '{\"339c3646-4049-42b4-b6b7-a416eae14fc4\": \"Brevetten\", \"45a0fc4e-c80d-4907-95af-12998b75a65f\": \"Lessen en brevetten\", \"4b5d0266-b49f-4510-bfa5-d8fc442d92b6\": \"<p>Bij Duikclub Dolfijn organiseren we zwembadtrainingen op dinsdagavond van 21u tot 22u, waar je onder begeleiding van onze ervaren instructeurs kunt werken aan je duikvaardigheden en -technieken. Deze praktijkgerichte sessies zijn essentieel voor het opbouwen van vertrouwen en comfort onder water.<br /><br />Daarnaast bieden we theorielessen aan in samenspraak met de cursisten die werken aan een specifiek duikbrevet. Onze instructeurs staan klaar om de benodigde kennis te delen en eventuele vragen te beantwoorden ter voorbereiding op examenmomenten.</p><p>Voor liefhebbers van buitenduiken organiseren we regelmatig duikuitstapjes op basis van activiteiten in onze kalender. Dit biedt de ideale gelegenheid om je duikvaardigheden toe te passen in natuurlijke omgevingen en nieuwe duiklocaties te verkennen.<br /><br />Wil je meer weten over onze lessen en brevetten? Neem contact met ons op of kom langs tijdens een van onze zwembadtrainingen om kennis te maken met Duikclub Dolfijn en ons enthousiaste team van duikliefhebbers!</p>\"}', 1, '2024-06-15 22:58:21', '2024-06-15 22:58:21', 'bab30029-1c19-42b2-a339-489defb98deb'),
