(589, 589, 1, 'Over ons', 'over-ons', 'over-ons', '{\"32fdd704-f45a-499b-bac9-c9090f2f0265\": \"Met dank aan:\", \"399ce0e5-7f58-4fee-bd35-b3a95b21ab50\": \"Over de duikclub\", \"73504e16-f45a-49a9-baf2-1a461a4b4aeb\": \"<p>Duikclub Dolfijn is een enthousiaste en gezellige duikvereniging gevestigd in Bilzen. Onze club is opgericht met als doel duikliefhebbers samen te brengen en hen de kans te bieden om hun passie voor duiken te delen en te ontwikkelen. Of je nu een beginner bent die wil leren duiken of een ervaren duiker op zoek naar nieuwe duikavonturen, bij Duikclub Dolfijn ben je aan het juiste adres.<br /><br />Wij bieden een vriendelijke en ondersteunende omgeving waarin je kunt leren duiken onder begeleiding van ervaren instructeurs. Onze wekelijkse trainingsavonden in het Stedelijk Zwembad De Kimpel zijn een uitstekende gelegenheid om je duikvaardigheden te verbeteren of gewoon plezier te hebben met gelijkgestemde duikers. Daarnaast organiseren we regelmatig duikuitstapjes naar verschillende duiklocaties, zowel binnen als buiten BelgiÃ«.</p>\", \"af0198f9-40dd-4c08-9608-66990acd2e03\": \"Het bestuur\", \"d48a8852-c3e6-454c-92b5-dc5c780bbe9a\": \"Wat doen wij?\"}', 1, '2024-06-16 01:27:24', '2024-06-16 01:27:24', '71cbcb51-7721-4f09-8a01-1a7be65505fc'),
